CREATE DATABASE ToDo_WebService

DROP TABLE  IF EXISTS Tasks;

create table Tasks (
	TaskId INT PRIMARY KEY,
	Title TEXT,
	DueDate DATE,
	Place VARCHAR(50),
	Category VARCHAR(50),
	Description TEXT
);

create table TasksDone (
	FK_TaskId INT,
	Title TEXT,
	EndDate DATE,
);

ALTER TABLE TasksDone
ADD FOREIGN KEY (FK_TaskId) REFERENCES Tasks(TaskId)



